  "product.hint.characteristics": "Kadi za bidhaa hutoa muhtasari wa haraka wa kila zana ya kidijitali, ikiwa ni pamoja na taarifa kuhusu SDG ambayo yanaunga bidhaa mkono, pamoja na vipengele vyovyote vya msingi ambavyo vinaweza kuungwa mkono na bidhaa. Kadi zinaonyesha jinsi bidhaa inavyopewa leseni na pia taarufa kuhusu vyanzo vyetu vya taarifa ya bidhaa. ",
  "product.hint.description": "<ul><li><img class='m-1.5 h-5 inline' src='/icons/check/check.png' /><span class='inline p-2'>Inaonyesha kwamba bidhaa imeidhinishwa na shirika la ukaguzi</span></li><li><img class='m-1.5 h-5 inline' src='/icons/digiprins/digiprins.png' /><span class='inline p-2'>Inaonyesha kwamba bidhaa inadumishwa na kiidhinishaji cha Kanuni za Kidijitali </span></li><li><img class='m-1.5 h-5 inline' src='/icons/coronavirus/coronavirus.png' /><span class='inline p-2'>Inaonyesha kwamba bidhaa inaweza kutumika kukabiliana na COVID-19</span></li></ul>",

  "project.hint.characteristicTitle": "Maelezo",
  "project.hint.descriptionTitle": "Vyanzo vya Mradi",
  "project.hint.subtitle": "Mradi ni utekelezaji wa jukwaa la kidijitali katika muktadha maalum na/au sekta.",
  "project.hint.characteristics": "Miradi hutujulisha kuhusu mahali ambapo teknolojia mahususi za kidijitali zimetumika. Watumiaji wa Katalogi wanaweza kutafuta na kuchuja miradi kulingana na nchi au sekta. ",
  "project.hint.description": "Data ya mradi hutolewa kutoka kwa washirika wengi tofauti, ikiwa ni pamoja na Digital Health Atlas ya Shirika la Afya Duniani, Deutsche Gesellschaft für Internationale Zusammenarbeit (GIZ), na New America.",

  "playbook.hint.subtitle": "Vijitabu vya mwongozo ni miongozo ya utekelezaji ambayo huwasaidia watendaji mbalimbali kushughulikia mikakati ya kawaida ya kidijitali. Vinatoa maagizo ya hatua kwa hatua na kuangazia mambo muhimu ya kiufundi na kiutendaji.",
  "playbook.hint.characteristicTitle": "Maelezo",
  "playbook.hint.descriptionTitle": "Vyanzo",
  "playbook.hint.characteristics": "Vijitabu vya mwongozo husaidia kujibu maswali ya kawaida kama vile jinsi ya kushughulikia hali ambapo inaweza kutumiwa, kutumia mtiririko wa kazi, kusambaza bidhaa, kushirikiana na mshirika, au hata kuimarisha stadi na ujuzi ndani ya timu. Vina vipengele kadhaa:<ul><li>Hadhira: mtumiaji aliyekusudiwa kutumia nyenzo ya mwongozo</li><li>Matokeo: yaliyokusudiwa kuwa matokeo ya kijitabu cha mwongozo</li><li>Miongozo: muunganisho wa kazi (shughuli) ambayo lazima kikundi kifanye ili kutekeleza kitendo. Kila kijitabu cha mwongozo kinaweza kuwa na mfululizo wa miongozo. Miongozo inaweza kutumika tena na inaweza kuongezwa kwenye vijitabu vingi vya miongozo.</li><li>Shughuli: kazi za mtu binafsi zinazojumuisha mwongozo. Kila mwongozo unaweza kuwa na shughuli nyingi, na shughuli pia zinaweza kuunganishwa na vyanzo vya nje.</li></ul>",
  "playbook.hint.description": "Kila kijitabu cha mwongozo kina chanzo cha kipekee, kama ilivyoorodheshwa. Ikiwa una maudhui ambayo ungependa kuyageuza kuwa kijitabu cha mwongozo, wasiliana na timu yetu kwenye issues@solutions.dial.community",
  "playbook.hint.createPlaybooks": "Jisajili au uingie ili kuunda vitabu vya mbinu za utendaji",

