  "organization.hint.characteristics": "Kadi za shirika hutoa muhtasari wa haraka wa kila shirika, ikijumuisha taarifa kuhusu bidhaa wanazotumia, miradi au kazi ambazo wameunganishwa nazo, sekta wanazofanya nazo kazi na nchi wanazofanyia kazi.",
  "organization.hint.description": "Katalogi inafuatilia aina nyingi na tofauti za mashirika:<ul><li>Mashirika ambayo yameidhinisha Kanuni za Maendeleo ya Kidijitali</li><li>Wakala wa Mtandao wa Simu</li><li>Wafadhili na Watunzaji wa zana zinzoweza kubadilishwa (bidhaa)</li></ul>",

  "useCase.hint.characteristicTitle": "Sifa",
