  "useCase.hint.characteristics": "<ul><li>Maelezo ya msingi ya mtumiaji ya hatua au safari za mtumiaji zinazohitajika ili kutoa matokeo</li><li>Hubainisha Malengo moja au zaidi ya SDG kama lengo lake la biashara</li><li>Inafafanua Mitiririko ya Kazi ya jumla na michakato ya biashara inayohusika katika kila hatua katika Hali ambapo inaweza kutumiwa</li><li>Kwa kawaida huwa sekta mahususi</li><li>Inaweza kuboreshwa kupitia teknolojia ya kidijitali</li></ul>",
  "useCase.hint.description": "Kila kielelezo cha Kesi ya Matumizi kinafafanua wahusika wakuu, hatua muhimu zinazohusika katika kufikia lengo mahususi la biashara, maelezo ya Mitiririko ya Kazi na Vipengee vya Msingi vya ICT vinavyohusika katika kila hatua, na hatua zinazoelekeza kwa Malengo ya SDG. Orodha ya vielelezo vya Kesi ya Matumizi si kamilifu na vingine zaidi vitaongezwa katika matoleo yajayo.",

