  "workflow.hint.description": "Kila Mtiririko wa Kazi unajumuisha maelezo, mifano mahususi ya sekta, na mfano ya Hali ambapo inaweza kutumiwa zilizofafanuliwa katika mfumo huu. Orodha ya Mitiririko ya Kazi haijakamilishwa na mambo mengine zaidi yataongezwa katika matoleo yajayo.",
