  "covid.title": "Usaidizi wa DIAL wa COVID-19",
  "covid.description": "COVID-19 imekuwa janga kubwa zaidi la afya ya umma katika wakati wetu. Digital Impact Alliance (DIAL) imetengeneza nyenzo hii ya mtandaoni ili kusaidia mashirika na serikali kukabiliana na COVID-19. Ingawa hapo awali zana hii iliundwa kwa ajili ya kutathmini na kusambaza zana huria za kidijitali, inaweza pia kutumiwa kukabiliana na COVID-19 katika nyanja tatu:",
  "covid.description.firstArea": "Kutambua kwa haraka majukwaa ya programu yanayoweza kutumika kusaidia wahudumu wa afya walio mstari wa mbele na mashirika yanayofuatilia mikurupuko ya COVID-19.",
  "covid.description.secondArea": "Kutoa zana za kusanidi majukwaa ya ujumbe haraka.",
  "covid.description.thirdArea": "Kuunganisha raslimali zingine zilizotengenezwa na mashirika washirika.",

  "covid.exploreCatalog": "Chunguza Katalogi",

  "covid.firstArea.title": "Kutumia Katalogi ya Mtandaoni kwa ajili ya Kugundua Bidhaa",
  "covid.firstArea.firstText": "<p>Serikali na mashirika yanatafuta zana za kidijitali zisaidie katika ufuatiliaji, utambuzi, kinga na matibabu ya COVID-19.</p><p>Hata hivyo, huenda wasijue kuwa kuna masuluhisho ya chanzo huria yaliyo tayari kutumwa ili yakidhi mahitaji haya.</p><p><firstLink>Katalogi ya Mtandaoni</firstLink> ina orodha ya bidhaa huria zinazounga mkono SDG.</p><p>Watumiaji wanaweza kuchuja bidhaa kulingana na SDG ambazo zimeundwa kushughulikia, hali ambapo inaweza kutumiwa inayohusiana nayo, au vipengele vya msingi vinavyounga mkono.</p>",
  "covid.firstArea.secondText": "<p>Bidhaa kadhaa katika katalogi zimetambulishwa kama zinazowezesha utendakazi mahususi unaohitajika ili kukabiliana na COVID-19.</p><p> Ili kuona bidhaa hizi, tumia lebo ya '<b>COVID-19</b>' katika sehemu ya kichujio.</p><p> Bofya kwenye bidhaa maalum ili kupata maelezo ya kina kuhusu bidhaa.</p>",
  "covid.firstArea.thirdText": "<p>Ukurasa wa maelezo ya bidhaa utatoa maelezo ya bidhaa, viungo vya tovuti ya bidhaa na hifadhi ya msimbo, pamoja na data nyingine muhimu kuhusu bidhaa.</p>",
  "covid.secondArea.title": "Kutumia Katalogi ya Mtandaoni kwa ajili ya Majibu ya Ujumbe wa Simu ya Mkononi",
  "covid.secondArea.firstText": "<p>Serikali na mashirika yanahitaji kutoa taarifa za mara kwa mara kwa wapiga kura wao. Njia za kutuma ujumbe kwa simu ya mkononi ni nzuri sana, lakini zinaweza kuchukua muda na gharama kubwa kusanidi.</p><p> Lakini DIAL inaweza kusaidia. Tumekuza mahusiano na waunganishaji kadhaa wa mtandao wa simu duniani kote. Waunganishaji hawa wamekuza mahusiano na waendeshaji wa mtandao wa simu na wanaweza kusanidi huduma za simu haraka na kwa urahisi. Suluhisho la ujumbe wa rununu linaweza kuanzishwa ndani ya saa chache.</p><p> Katalogi ya mtandaoni ya DIAL huorodhesha waunganishaji wa huduma za mtandao wa simu wanaotoa huduma za simu duniani kote na huduma zinazotolewa.</p><p> Bofya kiungo hiki ili kuona<firstLink> ramani ya waunganishaji</firstLink> .</p><p> Unaweza pia kuenda hadi<secondLink> ukurasa mkuu wa bidhaa</secondLink>, ubofye sehemu ya '<b>Ramani</b>' kwenye kichupo cha kichujio na ubofye katika '<b>Ramani ya Mwunganishaji na Mwendeshaji</b>'.</p>",
  "covid.secondArea.secondText": "<p>Kwenye ukurasa wa ramani, bofya nchi ili kuonyesha ni waunganishaji wapi wanaofanya kazi katika nchi hiyo. Bofya mwunganishaji katika orodha hiyo ili kuona maelezo ya kina kuhusu huduma anazotoa na ni waendeshaji wapi wa mtandao anaoshirikiana nao.</p>",
  "covid.secondArea.thirdText": "<p>Chagua wakala ili uone maelezo ya mtoa huduma huyo. Sehemu ya Waendeshaji inaonyesha huduma zinazopatikana katika nchi na waendeshaji wa mtandao wanaotoa huduma hizo.</p><p>Kwa mfano, ikiwa unatafuta huduma za SMS Nyingi nchini Kenya, unaweza kupanua menyu ya SMS na uone kwamba huduma hizi zinatolewa na wakala huyu kupitia Safaricom.</p>",
  "covid.secondArea.fourthText": "<p>Vinginevyo, <firstLink>kiungo hiki</firstLink> kitaonyesha ukurasa unaoonyesha wakala wote wa simu walio kwenye katalogi. Chagua wakala yeyote ili uone nchi wanapofanya kazi, watoa huduma za mtandao wa simu wanaoshirikiana nao na huduma mahususi wanazotoa.</p>",

  "covid.thirdArea.title": "Nyenzo Zingine za COVID- 19",
  "covid.thirdArea.firstText": "<div>Watafiti wa Johns Hopkins wamechapisha tathmini ya Zana za Kidijitali za kukabiliana na COVID-19 ambazo zinaweza kutumiwa na nchi za kipato cha chini na kati.</div><ul><li><jsphLink> Tazama ripoti hiyo hapa</jsphLink></li></ul><div> CDC imeunda Mwongozo wa Zana za Kidijitali za kukabiliana na COVID-19</div><ul><li><cdcLink> Tazama mwongozo hapa</cdcLink></li></ul><div> Digital Square ina rasilimali kadhaa zinazopatikana ili kusaidia mashirika katika kukabiliana kwao na COVID.</div><ul><li><pathLink> Tazama warsha ya mtandaoni kuhusu bidhaa za kimataifa ambazo zimebadilishwa kufaa kwa ajili ya kukabiliana na COVID-19.</pathLink></li><li><deckLink> Tazama staha ya slaidi kutoka kwa warsha ya mtandaoni.</deckLink></li><li><digiSquareLink> Tazama bidhaa za kimataifa zinazotumika kwa Digital Square na jinsi zimerekebishwa ili kufaa kwa ajili ya COVID-19.</digiSquareLink></li></ul><div> Wakfu wa New America umeunda Hazina ya Kukabiliana na Janga inayoorodhesha rasilimali za kidijitali ili kusaidia serikali katika kukabiliana na COVID</div><ul><li><newAmericaLink> Tazama hazina hiyo hapa</newAmericaLink></li></ul><div> UNDESA imeunda Mkusanyiko wa Mipango Kidijitali ya Serikali katika kukabiliana na Janga la COVID-19</div><ul><li><unPandemicLink> Tazama hati hiyo hapa</unPandemicLink></li></ul>",
